import React from 'react'
import socials from '../../Socials'
import styled from 'styled-components'
import ModularSummit from '../../assets/modularSummit.webp'
import ModularMeetup from '../../assets/modularMeetup.webp'

const Slider = styled.div`
    width: 90%;
    display: flex;
    gap: 1em;

    &::children{
        width: 40%;
    }
`

const SocialContainer = styled.div`
    display: flex;
    // flex-wrap: wrap;
    width: 40%;
    background-color: red;
`

const ImageContainer = styled.div`
    width: 100%;
`

function Landing4() {
  return (
    <section>
        <h2>Join the community</h2>
        <p>Join the Celestia community online or hang out at one of the grassroots Modular Meetups</p>
        <Slider>
            <SocialContainer>
                {
                    socials.map((social) => {
                        return(
                        <div>
                            {social.social}
                        </div>
                        )
                    })
                }
            </SocialContainer>
            <ImageContainer>
                <p>Modular Summit 2023</p>
                <img src={ModularSummit}/>
            </ImageContainer>
            <div>
                <p>Modular Meetup</p>
                <img src={ModularMeetup}/>
            </div>
        </Slider>
    </section>
  )
}

export default Landing4
